import axios from 'axios';

function getIp() {
  const ip = fetch('https://ipapi.co/json/').then(d => d.json());
  console.log(ip);
  return ip;
} 

export const getLocation = async () => {
  const ip = await getIp();
  const response = await axios.get('http://ipwho.is/' + ip);
  return response;
}
